interface MyProps {
  content: string;
}

function ChilComp({ content }: MyProps) {
  return (
    <>
      <h1 className='text-center'>{content}</h1>
    </>
  );
}


function PropsMacDinh() {
  return (
    <>
      <ChilComp />
    </>
  );
}
export default PropsMacDinh;
